import React from "react";

import manoSpock from "../../images/engranaje.png";

import { motion } from "framer";

import "./Background.css";

const Background = () => {
  const background = [
    "react",
    "htlm5",
    "css",
    "js",
    "mongo",
    "github",
    "git",
    "angular",
  ];
  return (
    <div className="Background">
      <motion.img
        src={manoSpock}
        alt="Mano Spock"
        animate={{ rotateY: 360 }}
        transition={{ loop: Infinity, ease: "linear", duration: 40 }}
        style={{
          position: "absolute",
          top: "5vw",
          left: "6vw",
          width: "20vw",
          opacity: 0.5,
        }}
      />
      <motion.img
        src={manoSpock}
        alt="Mano Spock"
        animate={{ rotateY: 360 }}
        transition={{ loop: Infinity, ease: "linear", duration: 40 }}
        style={{
          position: "absolute",
          bottom: "5vw",
          left: "8vw",
          width: "18vw",
          opacity: 0.5,
        }}
      />
      <motion.img
        src={manoSpock}
        alt="Mano Spock"
        animate={{ rotateY: 360 }}
        transition={{ loop: Infinity, ease: "linear", duration: 40 }}
        style={{
          position: "absolute",
          top: "3vw",
          right: "5vw",
          width: "16vw",
          opacity: 0.5,
        }}
      />
      <motion.img
        src={manoSpock}
        alt="Mano Spock"
        animate={{ rotateY: 360 }}
        transition={{ loop: Infinity, ease: "linear", duration: 40 }}
        style={{
          position: "absolute",
          bottom: "7vw",
          right: "8vw",
          width: "18vw",
          opacity: 0.5,
        }}
      />
    </div>
  );
};

export default Background;
